package com.doctor.assistant.experiment.czy.entity;import com.doctor.assistant.experiment.czy.poi.excel.annotation.Excel;import lombok.Data;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.Table;/** * 评估指标仿真动态值 : kpi计算所得的实时数据 *  updateOrSaveByKpiId (有则更新，无则新增) */@Data@Entity@Tablepublic class EvalKpiSimValue {  @Excel(name = "批次号")  Integer inputBatch;  @Excel(name = "发生", databaseFormat = "yyyy-MM-dd hh:mm:ss", importConvert = false)  String ts;  @Id  @Excel(name = "评估指标模板")  Integer kpiId;  @Excel(name = "模拟")  Double simTimeFromTo;  @Excel(name = "产品编号")  Integer productId;  @Excel(name = "制造厂")  String manufactoryName;  @Excel(name = "存贮名")  String storeName;  @Excel(name = "商品名称")  String shopName;  @Excel(name = "指标")  float value;  @Excel(name = "备注")  String comment;}